import React from 'react'
import AblePlayer from 'react-able-player'
import $ from 'jquery';
import { Cookie } from 'react-cookie'
import video from './Assets/bgvid.860475ab.mp4';

const Video = () => {
    return (
        <div>
            <video id="video1" data-able-player preload="auto" width="480" height="360" poster="path_to_image.jpg" data-youtube-id="9bZkp7q19f0">
                <track kind="captions" src="path_to_captions.vtt" />
                <track kind="descriptions" src="path_to_descriptions.vtt" />
            </video>
        </div>
    )
}

export default Video
